import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './SupportDashboard.css';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
  const navigate = useNavigate();

  const [tab, setTab] = useState('category');
  const [items, setItems] = useState([]);
  const [newItem, setNewItem] = useState('');
  const [loading, setLoading] = useState(false);

  const tabConfig = {
    category: { title: 'Kategoriler', api: 'categories' },
    priority: { title: 'Öncelikler', api: 'priorities' },
    status: { title: 'Durumlar', api: 'statuses' },
  };

  const fetchItems = async () => {
    try {
      setLoading(true);
      const token = localStorage.getItem('token');
      const res = await axios.get(`http://localhost:5094/api/${tabConfig[tab].api}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setItems(res.data);
    } catch (err) {
      console.error(`${tab} verisi alınamadı:`, err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchItems();
  }, [tab]);

  const handleAddItem = async () => {
    if (!newItem.trim()) return;

    const token = localStorage.getItem('token');
    try {
      await axios.post(`http://localhost:5094/api/${tabConfig[tab].api}`, {
        name: newItem
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setNewItem('');
      fetchItems();
    } catch (err) {
      console.error("Ekleme hatası:", err);
    }
  };

  const handleDelete = async (id) => {
    const token = localStorage.getItem('token');
    try {
      await axios.delete(`http://localhost:5094/api/${tabConfig[tab].api}/${id}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      fetchItems();
    } catch (err) {
      console.error("Silme hatası:", err);
    }
  };

  return (
    <div className="support-container">
      <div className="sidebar">
        <div className="logo">AdminPanel</div>
        <ul className="nav">
          <li onClick={() => navigate('/ticket-list')} style={{ cursor: 'pointer' }}>
            <span className="icon">🎫</span> <span className="label">Tickets</span>
          </li>
        </ul>

        <div className="profile">
          <img src="https://i.pravatar.cc/40" alt="admin" />
          <span>Admin</span>
        </div>
      </div>

      <div className="main-content">
        <div className="tab-nav">
          {Object.keys(tabConfig).map(key => (
            <button
              key={key}
              className={tab === key ? 'active' : ''}
              onClick={() => setTab(key)}
            >
              {tabConfig[key].title}
            </button>
          ))}
        </div>

        <div className="form-box content-box">
          <h2>{tabConfig[tab].title} Yönetimi</h2>

          {loading ? (
            <p>Yükleniyor...</p>
          ) : (
            <>
              <ul className="ticket-list">
                {items.map(item => (
                  <li key={item.id}>
                    {item.name}
                    <button
                      onClick={() => handleDelete(item.id)}
                      style={{ marginLeft: '10px', color: 'red', border: 'none', background: 'none', cursor: 'pointer' }}
                    >
                      ❌
                    </button>
                  </li>
                ))}
              </ul>

              <div style={{ display: 'flex', gap: '10px', marginTop: '10px' }}>
                <input
                  type="text"
                  value={newItem}
                  onChange={(e) => setNewItem(e.target.value)}
                  placeholder={`Yeni ${tabConfig[tab].title.slice(0, -1)} adı`}
                />
                <button onClick={handleAddItem}>Ekle</button>
              </div>
            </>
          )}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
